Moms, you can get overstimulated too

If you get angry or overwhelmed easily, you might be overstimulated. Get grounded &amp; reduce inputs... Get off screens, find a quiet room, meditate, sing, read a book, play an instrument, go for a walk

I know that's easier said than done &amp;

@KanekoaTheGreat I spoke with Rep Tony Gonzales tonight – he confirmed that it is a serious issue. 

They are being overwhelmed by unprecedented numbers – just hit an all-time high and still growing!

Am going to visit Eagle Pass later this week to see what’s going on for myself.
